pdfShortResults:{message:"Zusammenfassung"},pdfTableHeadCode:{message:"Quelle im Code"},pdfTableHeadCount:{message:"Fehleranzahl"},pdfTableHeadErrorContent:{message:"Fehlerbeschreibung"},pdfTableHeadUrl:{message:"Seitenursprung"},pdfTableHeadVisual:{message:"Visualisierung"},pdfTop1:{message:"Top"},pdfTop2:{message:"gefundene Warnungen:"},perceivableTxt:{message:"Wahrnehmbarkeit"},presentationalChildFocusContent:{message:"Element hat versteckte fokussierbare Kindelemente"},presentationalChildFocusExplanation:{message:"Diese Regel pr\u00fcft, dass Elemente mit einer Rolle, die ihre Kindelemente als dekorativ kennzeichnet, keine fokussierbaren Elemente enthalten. Solche Elemente sind beispielsweise vom Typ <button>, checkbox oder <img>. Die Kindelemente dieser Elemente werden von Hilfstechnologien nicht korrekt erkannt."},
presentationalChildFocusTip:{message:"F\u00fcgen Sie keine fokussierbaren Elemente als Kinder von Elementen mit einer Rolle hinzu, die ihre Kinder automatisch als dekorativ kennzeichnet."},prevElmTip:{message:"Vorheriger Fehler"},preventZoomContent:{message:"Meta viewport verhindert Zoom"},preventZoomExplanation:{message:'Die Verwendung von <meta name="viewport">-Elementen kann die Zoom-M\u00f6glichkeiten des Nutzers einschr\u00e4nken, insbesondere auf mobilen Ger\u00e4ten. Das Zoomen ist ein \u00fcbliches und erwartetes "erlaubtes" Verhalten auf Webseiten, so dass die Deaktivierung des Zoomens das Nutzererlebnis beeintr\u00e4chtigt.'},
preventZoomTip:{message:'Entfernen Sie die Attribute user-scalable und maximum-scale. Andernfalls stellen Sie sicher, dass das Attribut-Content nicht user-scalable auf "no" setzt und dass die Eigenschaft maximum-scale mindestens 2 betr\u00e4gt.'},ptextNotInLandmarkTip:{message:"F\u00fcgen Sie alle Textinhalte bestehenden Seitenregionen hinzu oder erstellen Sie neue Regionen."},referenceLinkTip:{message:"Mehr Informationen zu diesem Fehler"},regionMissingNameContent:{message:"Fehlender zug\u00e4nglicher Name f\u00fcr Region"},
regionMissingNameExplanation:{message:'Die "region"-Rolle wird verwendet, um Dokumentbereiche zu identifizieren, die der Autor der Webseite f\u00fcr wichtig h\u00e4lt. Jede Region ben\u00f6tigt einen zug\u00e4nglichen Namen, damit Benutzer von Screenreadern deren Inhalt und Zweck erkennen k\u00f6nnen.'},regionMissingNameTip:{message:"F\u00fcgen Sie der Region mithilfe von Aria-Attributen einen zug\u00e4nglichen Namen hinzu."},requiredChildrenMissingContent:{message:"Erforderliche Elemente fehlen"},
requiredChildrenMissingExplanation:{message:'Einige Elemente mit einer expliziten semantischen Rolle m\u00fcssen mindestens eines ihrer erforderlichen Kind-Elemente haben. Zum Beispiel muss ein Element mit der Rolle "list" Elemente mit der Rolle "listitem" besitzen. Wird diese Anforderung nicht erf\u00fcllt, kann das Element selbst ung\u00fcltig werden.'},requiredChildrenMissingTip:{message:"Pr\u00fcfen Sie, ob die Rolle des Elements korrekt verwendet wurde, oder stellen Sie sicher, dass Sie die erforderlichen Kind-Elemente verwendet werden."},
requiredParentMissingContent:{message:"Erforderlicher Elternknoten fehlt"},requiredParentMissingExplanation:{message:'Einige Elemente mit einer expliziten semantischen Rolle m\u00fcssen ein bestimmtes \u00fcbergeordnetes Elternelement haben. Zum Beispiel braucht ein Element mit der Rolle "listitem" einen \u00fcbergeordneten Knoten mit der Rolle "list". Wird diese Anforderung nicht erf\u00fcllt, ist das Element selbst ung\u00fcltig.'},requiredParentMissingTip:{message:"Pr\u00fcfen Sie, ob die Rolle des Elements korrekt verwendet wurde, oder stellen Sie sicher, dass Sie den erforderlichen Elternknoten und Rolle verwenden."},
resetInputContent:{message:"Reset-Button ist nicht empfohlen"},resetInputExplanation:{message:"Die Verwendung von Reset-Buttons ist nicht empfohlen, da diese leicht aus Versehen geklickt werden k\u00f6nnen."},resetInputTip:{message:"Entfernen Sie den Reset Knopf falls m\u00f6glich."},restrictedOrientationContent:{message:"Die Ausrichtung der Seite ist eingeschr\u00e4nkt"},restrictedOrientationExplanation:{message:'Mit dieser Regel wird \u00fcberpr\u00fcft, dass der Seiteninhalt nicht durch die CSS-Eigenschaft transform auf eine einzige Ausrichtung im Hoch- oder Querformat beschr\u00e4nkt ist. Elemente, die auf eine bestimmte Drehung festgelegt sind, indem die CSS-Eigenschaft "orientation media" mit dem Wert "landscape" oder "portrait" verwendet wird, k\u00f6nnen auf mobilen Ger\u00e4ten m\u00f6glicherweise nicht korrekt gedreht werden.'},
restrictedOrientationTip:{message:"Vergewissern Sie sich, dass sich alle Elemente auf der Website beim Wechsel vom Hoch- zum Querformat richtig gedreht werden."},retractButton:{message:"Alle Einklappen"},robustTxt:{message:"Robustheit"},ruleOpenImgAlt:{message:"Fehler anzeigen"},rulesOverviewHeading:{message:"\u00dcbersicht \u00fcber alle Eye-Able\u00ae Audit Regeln"},rulesOverviewRegion:{message:"Regeln"},rulesOverviewTxt:{message:"Zeigt alle verf\u00fcgbaren Regeln an. Als WCAG Kapitel wird immer nur die prim\u00e4re Referenz angezeigt, eine Regel kann jedoch Bezug auf mehrere WCAG Kapitel nehmen."},
scanAgain:{message:"Seite erneut pr\u00fcfen"},scrollableKeyboardContent:{message:"Scrollbares Element ist nicht \u00fcber die Tastatur zug\u00e4nglich"},scrollableKeyboardExplanation:{message:"Diese Regel pr\u00fcft, ob scrollbare Elemente mit der Tastatur gescrollt werden k\u00f6nnen. Um sicherzustellen, dass es ein Element gibt, von dem aus die Pfeiltasten zur Steuerung der Scrollposition verwendet werden k\u00f6nnen, muss der Fokus auf oder in einem Kindelement liegen k\u00f6nnen."},scrollableKeyboardTip:{message:"Stellen Sie sicher, dass jedes scrollbare Element oder eines seiner untergeordneten Elemente fokussierbar ist."},
selectLabelContent:{message:"<select> hat keinen zug\u00e4nglichen Namen"},selectLabelExplanation:{message:"<select>-Elemente m\u00fcssen einen zug\u00e4nglichen Namen besitzen, damit Screenreader deren Zweck wiedergeben k\u00f6nnen."},selectLabelTip:{message:"Beschreiben Sie den Zweck der Auswahlliste mit einem <label> Element oder Aria-Attributen."},settingsHeading:{message:"Einstellungen"},settingsRegion:{message:"Einstellungen"},shortTitleContent:{message:"Seite hat einen sehr kurzen Titel"},
shortTitleExplanation:{message:"Der Titel der Seite ist wichtig um das Thema oder den Zweck der Seite zu beschreiben. Er erlaubt es Besuchern der Webseite diese inhaltlich einzuordnen oder zu finden."},shortTitleTip:{message:"Pr\u00fcfen Sie, ob der Titel die Seite ausreichend beschreibt."},skipSelectorSetting:{message:"Elemente von Tests ausnehmen"},skipSelectorText:{message:"Geben Sie kommagetrennt CSS-Selektoren an um Elemente und deren Kinder von der Pr\u00fcfung auszunehmen. Die Syntax entspricht der, welche auch in CSS-Regeln verwendet wird."},
sliderTxt:{message:"Problem"},slideSeperator:{message:"von"},smallFontSizeContent:{message:"Schriftgr\u00f6\u00dfe ist sehr klein"},smallFontSizeExplanation:{message:"Diese Regel pr\u00fcft, dass Schriftgr\u00f6\u00dfen auf der Seite gr\u00f6\u00dfer als 9 Pixel sind. Kleine Schriftgr\u00f6\u00dfen sind nicht gut lesbar und sollten nach M\u00f6glichkeit vermieden werden."},smallFontSizeTip:{message:"Pr\u00fcfen Sie, ob die Schriftgr\u00f6\u00dfe auf mindestens 10px erh\u00f6ht werden kann. Im Allgemeinen wird f\u00fcr normalen Text eine Schriftgr\u00f6\u00dfe von 16 px oder mehr empfohlen."},
srAuditStart:{message:"Pr\u00fcfung gestartet"},srIssues:{message:"Probleme"},startButtonHeading:{message:"Eye-Able Audit starten"},startButtonTxt:{message:"\u00d6ffnet das Men\u00fc und zeigt die gefundenen Probleme."},svgLongAltContent:{message:"<svg> Beschriftung etwas lang (>80 Zeichen)"},svgLongAltExplanation:{message:"Die SVG Beschriftung ist etwas lang (>80 Zeichen) und kann m\u00f6glicherweise zusammengefasst werden. Viele blinde Menschen lesen Texte mithilfe einer Braillezeile. Eine Braillezeile kann mindestens 40 Zeichen, aber nur maximal 80 Zeichen ausgeben."},
