svgVeryLongAltContent:{message:"<svg> Beschriftung sehr lange (>150 Zeichen)"},svgVeryLongAltExplanation:{message:"Die SVG Beschriftung ist m\u00f6glicherweise zu lange (>150 Zeichen) und kann zusammengefasst werden. Viele blinde Menschen lesen Texte mithilfe einer Braillezeile. Eine Braillezeile kann mindestens 40 Zeichen, aber nur maximal 80 Zeichen ausgeben."},svgVeryLongAltTip:{message:"Fassen Sie die Beschreibung auf das Wesentliche zusammen."},tableResult1:{message:"Pr\u00fcfschritt"},tableResult2:{message:"WCAG Referenz"},
tableResult3:{message:"Ergebnis"},tableResult4:{message:"Anzahl an Fehlern"},tableResult5:{message:"WCAG Lvl"},tableResultNoResults:{message:"Noch kein Test durchgef\u00fchrt."},textNotInLandmarkContent:{message:"Text nicht in Seitenregion enthalten"},textNotInLandmarkExplanation:{message:'<a target="_blank" href="https://www.w3.org/WAI/ARIA/apg/example-index/landmarks/HTML5.html">Seitenregionen</a> kennzeichnen programmatisch Abschnitte einer Seite. Es empfiehlt sich, den gesamten Inhalt der Seite in die Seitenregionen (eng. "landmarks) zu strukturieren. Dadurch k\u00f6nnen Benutzer von Screenreadern leicht von einem Abschnitt zum anderen zu navigieren, ohne den \u00dcberblick \u00fcber den Inhalt zu verlieren. Beispiele f\u00fcr Regionen sind Header, Footer oder Main.'},
textNotInLandmarkTip:{message:"F\u00fcgen Sie alle Textelemente zu vorhandenen Landmarken hinzu oder erstellen Sie neue."},tooltippTip:{message:"Tipp"},unassignedDataCellContent:{message:"Datenzelle hat keinen Tabellenkopf zugeordnet"},unassignedDataCellExplanation:{message:"Diese Regel pr\u00fcft, ob jeder Datenzelle <td> einem Tabellenkopf <th> zugeordnet ist."},unassignedDataCellTip:{message:"F\u00fcgen Sie jeder Datenzelle <td> einen Tabellenkopf <th> hinzu."},unassignedTableHeaderContent:{message:"Tabellenkopf hat keine Daten zugeordnet"},
unassignedTableHeaderExplanation:{message:"Diese Regel pr\u00fcft, ob jedem Tabellenkopf <th> Zellen in einem Tabellenelement <td> zugeordnet sind."},unassignedTableHeaderTip:{message:"Entfernen Sie Tabellenkopfzellen, denen keine Zellen zugeordnet sind, oder ordnen Sie Zellen dem Kopf zu."},understandableTxt:{message:"Verst\u00e4ndlichkeit"},veryLowContrastContent:{message:"Sehr niedriger Kontrast erkannt"},veryLowContrastExplanation:{message:"Es wurde ein sehr niedriger Kontrast erkannt. Teilweise kann dies auf die Verwendung von Hintergrundbildern hindeuten. Bitte pr\u00fcfen Sie den Kontrast manuell."},
veryLowContrastTip:{message:"Erh\u00f6hen Sie den Kontrast, z.B. durch eine dunklere/hellere Schriftfarbe. Achten Sie auf ausreichende Kontraste der Texte bei Hintergrundbildern."},videoDetectedContent:{message:"Video erkannt"},videoDetectedExplanation:{message:"Pr\u00fcfen Sie, ob bei dem Video eine Medienalternative ben\u00f6tigt wird. Ebenso Stumme Videodateien (ohne Stimme) sind f\u00fcr blinde Nutzende nicht verf\u00fcgbar. Auch diese brauchen eine vollwertige Medienalternative (Text, alternative Tonspur oder Audiodatei)."},
videoDetectedTip:{message:"Pr\u00fcfen Sie, ob bei dem Video eine Medienalternative ben\u00f6tigt wird und stellen Sie diese gegebenenfalls zur Verf\u00fcgung."},visibleLabelContent:{message:"Sichtbare Bezeichnung nicht Teil des zug\u00e4nglichen Namens"},visibleLabelExplanation:{message:"Diese Regel pr\u00fcft, dass interaktive Elemente ihre sichtbare Bezeichnung als Teil ihres zug\u00e4nglichen Namens haben, z. B. bei der Verwendung von aria-label. Dies ist besonders wichtig f\u00fcr Nutzer, die die Website per Spracheingabe steuern. Andernfalls kann die Spracheingabe nicht korrekt interpretiert werden."},
visibleLabelTip:{message:"Stellen Sie sicher, dass die sichtbare Bezeichnung im zug\u00e4nglichen Namen enthalten ist. Zus\u00e4tzlicher Kontext kann durch die Verwendung der zug\u00e4nglichen Beschreibung (z.B. durch die Verwendung von aria-describedby) einbezogen werden."},w3cCheckHeading:{message:"HTML Syntax Pr\u00fcfung"},w3cCheckTxt:{message:"Pr\u00fcfen Sie das HTML dieser Seite mit dem W3C Syntax Checker."},warningTxt:{message:"Test"},windowButtonTxt:{message:"WCAG-Test starten und Fenster \u00f6ffnen (auch mit ALT + F5)"},
