guidedTestInfoTextHeading:{message:"Informationen zum gef\u00fchrten Alternativtext-Test:"},guidedTestInfoText:{message:"Dieser Test unterst\u00fctzt Sie beim Pr\u00fcfen von Alternativtexten f\u00fcr Bilder. Alternativtexte sollten manuell auf ihre Barrierefreiheit hin \u00fcberpr\u00fcft werden, da eine automatische \u00dcberpr\u00fcfung auf Sinnhaftigkeit und Aussagekraft der Texte nicht m\u00f6glich ist. Hierf\u00fcr ist es erforderlich, sowohl Bilder mit als auch ohne Fehler und Warnungen einzubeziehen.<br> In der untenstehenden Tabelle sind alle Bilder aufgef\u00fchrt, die auf der betrachteten Seite gefunden wurden, inklusive ihrem Alternativtext und dem entsprechenden HTML-Attribut. Dar\u00fcber hinaus werden, falls vorhanden, Audit-Fehler und Tipps zur Fehlerbehebung f\u00fcr den Alternativtext aufgef\u00fchrt und der Dateiname des Bildes angezeigt."},
guidedTestRecommendationsHeaderTxt:{message:"Empfehlungen f\u00fcr geeigneten Alternativtext:"},guidedTestTip1:{message:"Verwenden Sie f\u00fcr Element mit dem HTML-Tag &lt;img&gt; das alt-Attribut"},guidedTestTip2:{message:"F\u00fcr andere Elemente mit role='img' verwenden Sie aria-labelledby oder aria-label"},guidedTestTip3:{message:"Bewerten Sie den informativen Wert des Elements/Bildes. Sollte kein informativer Wert vorhanden sein kann das Element/Bild als dekoratives Element behandelt werden und ben\u00f6tigt keinen Alternativtext"},
guidedTestTip4:{message:"Versuchen Sie die wichtigsten Informationen in den Fokus zu setzen"},guidedTestTip5:{message:"Achten Sie auf Pr\u00e4gnanz. Sollte eine l\u00e4ngere Beschreibung notwendig sein, um den Zweck des Bildes zu erkl\u00e4ren nutzen Sie zus\u00e4tzlich long description methods"},guidedTestTip5MoreInfo:{message:"Weitere Informationen"},guidedTestTip6:{message:"Verwenden Sie Satzzeichen zur Erleichterung des Textverst\u00e4ndnisses"},guidedTestTip7:{message:"Vermeiden Sie \u00fcberfl\u00fcssige Informationen wie die W\u00f6rter &ldquo;Bild&rdquo; oder &ldquo;Symbol&rdquo;. Diese Informationen werden von Screenreadern bereits \u00fcbermittelt"},
