invalidAutocompleteExplanation:{message:"This rule applies to any HTML <input>, <select> and <textarea> element with an autocomplete attribute value. The autocomplete attribute needs a correct value to be recognized by the browser."},invalidAutocompleteTip:{message:'Make sure <a target="_blank" href="https://developer.mozilla.org/en-US/docs/Web/HTML/Attributes/autocomplete">the autocomplete value</a> is supported.'},invalidLangContent:{message:"Invalid lang attribute detected"},invalidLangExplanation:{message:'The lang attribute in the <html> element must be a valid language code and conform to the BCP 47 standard, e.g. "de" or "en-us".'},
invalidLangTip:{message:"Make sure that a valid language code is set as the lang attribute of the <html> element."},invalidValueAriaContent:{message:"Unsupported ARIA state or property value"},invalidValueAriaExplanation:{message:'This rule checks that the value of <a target="_blank" href="https://www.w3.org/TR/wai-aria/">ARIA states</a> or properties are allowed for the element they are specified on. The ARIA states or properties should be according to the official specification.'},invalidValueAriaTip:{message:"Remove unspecified ARIA values of states or properties or correct them to the correct value."},
