guidedTestInfoText:{message:"Estas pruebas guiadas le ayudan a comprobar los textos alternativos de las im\u00e1genes. Para la accesibilidad, debe revisar manualmente los textos alternativos para asegurarse de su sentido y significado. Para ello, es necesario incluir im\u00e1genes con y sin errores y advertencias.<br> La siguiente tabla enumera todas las im\u00e1genes de la p\u00e1gina junto con su texto alternativo y el atributo HTML correspondiente. Tambi\u00e9n enumera los errores de auditor\u00eda revisados anteriormente y las sugerencias para corregirlos, junto con el nombre del archivo de imagen."},
