newBadge:{message:"Nuevo"},allyAIError:{message:"### Error en la solicitud de Ally\nPor favor, int\u00e9ntelo de nuevo m\u00e1s tarde o p\u00f3ngase en contacto con el soporte a trav\u00e9s de support@eye-able.com para obtener ayuda."},allyTokenLimit:{message:"### L\u00edmite de solicitudes alcanzado\nDependiendo del paquete reservado, s\u00f3lo hay disponible un n\u00famero limitado de solicitudes. El n\u00famero es especialmente limitado sin un paquete adicional. Este l\u00edmite se ha alcanzado y se restablecer\u00e1 autom\u00e1ticamente durante la semana. Puede seguir utilizando Ally directamente aumentando el n\u00famero de solicitudes disponibles. Para m\u00e1s informaci\u00f3n, p\u00f3ngase en contacto con el equipo de asistencia en support@eye-able.com."},
