abbrWarnings:{message:"Abr\u00e9viations manquantes"},altWarnings:{message:"Textes alternatifs manquants"},altforLinks:{message:"Lien vers la sous-page"},appDesc:{message:"V\u00e9rifiez que votre site web ne contient pas les erreurs WCAG/ADA les plus courantes."},appName:{message:"Audit Eye-Able\u00ae pour WCAG"},ariaHiddenElementContent:{message:"L'\u00e9l\u00e9ment Aria-hidden a un contenu focalisable"},ariaHiddenElementExplanation:{message:"En ajoutant aria-hidden=\"true\" \u00e0 un \u00e9l\u00e9ment, l'\u00e9l\u00e9ment lui-m\u00eame et tous ses descendants sont cach\u00e9s aux technologies d'assistance. L'exposition de l'\u00e9l\u00e9ment \u00e0 la navigation s\u00e9quentielle peut \u00eatre source de confusion pour les utilisateurs de technologies d'assistance, car l'\u00e9l\u00e9ment est accessible alors qu'il devrait \u00eatre cach\u00e9."},
ariaHiddenElementTip:{message:"V\u00e9rifiez si l'\u00e9l\u00e9ment doit \u00eatre cach\u00e9 aux technologies d'assistance et, le cas \u00e9ch\u00e9ant, supprimez-le de la navigation s\u00e9quentielle."},audioDetectedContent:{message:"Audio d\u00e9tect\u00e9"},audioDetectedExplanation:{message:"V\u00e9rifiez si l'information est transmise dans l'audio (par exemple, par une voix de commentaire). Si c'est le cas, une transcription est n\u00e9cessaire."},audioDetectedTip:{message:"V\u00e9rifiez si une transcription est n\u00e9cessaire pour le fichier audio. Si c'est le cas, proposez une alternative, par exemple une transcription textuelle."},
autoAuditSetting:{message:"Ex\u00e9cuter l'audit automatiquement apr\u00e8s le chargement de la page"},autoAuditText:{message:"L'ex\u00e9cution d'un test peut n\u00e9cessiter beaucoup de performances. Si vous d\u00e9sactivez ce param\u00e8tre, les tests ne seront ex\u00e9cut\u00e9s que lorsque vous acc\u00e9derez au tableau de bord du site."},autoplayContent:{message:"L'\u00e9l\u00e9ment <audio> ou <video> joue automatiquement le son."},autoplayExplanation:{message:"Les s\u00e9quences audio ou vid\u00e9o diffus\u00e9es automatiquement ne peuvent pas durer plus de 3 secondes ou n\u00e9cessiter un m\u00e9canisme de contr\u00f4le audio pour les arr\u00eater ou les mettre en sourdine."},
autoplayTip:{message:"Ne jouez pas automatiquement le son ou assurez-vous qu'il existe un m\u00e9canisme de contr\u00f4le pour l'arr\u00eater ou le mettre en sourdine."},bestPracticeInputTxt:{message:"R\u00e8gles de bonnes pratiques"},bestPracticeTxt:{message:"Meilleures pratiques"},best_practice:{message:"Meilleures pratiques"},best_practice_desc:{message:"Inclut des lignes directrices qui ne sont pas obligatoires en vertu des WCAG, mais qui sont utiles pour un site web accessible."},bodyAriaHiddenContent:{message:"Le corps est cach\u00e9 dans l'aria"},
bodyAriaHiddenExplanation:{message:"L'\u00e9l\u00e9ment body contient l'attribut aria-hidden : \"true\" et la page n'est donc pas accessible aux lecteurs d'\u00e9cran."},bodyAriaHiddenTip:{message:"Supprime l'attribut aria-hidden de l'\u00e9l\u00e9ment body."},categorySetting:{message:"Pr\u00e9senter des tests uniquement dans les cat\u00e9gories suivantes"},categoryText:{message:"Dans certains cas, vous n'avez aucun contr\u00f4le sur certains types d'erreurs, par exemple dans le code de la page. Si, par cons\u00e9quent, seules les r\u00e8gles d'une certaine cat\u00e9gorie doivent \u00eatre affich\u00e9es, des filtres correspondants peuvent \u00eatre activ\u00e9s ici."},
