decorativeElementFocusTip:{message:'V\u00e9rifier si l\'\u00e9l\u00e9ment doit \u00eatre marqu\u00e9 comme d\u00e9coratif ou le cacher aux technologies d\'assistance, par exemple en utilisant aria-hidden="true" ou role="presentation".'},decorativeImageExposedContent:{message:"L'image d\u00e9corative est expos\u00e9e aux technologies d'assistance"},decorativeImageExposedExplanation:{message:"Cette r\u00e8gle v\u00e9rifie que les images marqu\u00e9es comme d\u00e9coratives ne sont pas incluses dans l'arbre d'accessibilit\u00e9 ou qu'elles ont un r\u00f4le de pr\u00e9sentation. Le fait de marquer un \u00e9l\u00e9ment comme d\u00e9coratif le cache aux technologies d'assistance, mais le fait de le rendre focalisable l'expose. Ce conflit doit \u00eatre \u00e9vit\u00e9."},
decorativeImageExposedTip:{message:'V\u00e9rifier si l\'image doit \u00eatre marqu\u00e9e comme d\u00e9corative ou la cacher aux technologies d\'assistance, par exemple en utilisant aria-hidden="true" ou role="presentation".'},designSetting:{message:"R\u00e8gles de conception"},docuLink:{message:"Acc\u00e9der \u00e0 la documentation"},docuLinkLocal:{message:"public/Documentation_Eye_Able_Audit.pdf"},elementInvalidLangContent:{message:"D\u00e9tection d'un \u00e9l\u00e9ment dont l'attribut lang n'est pas valide"},
