falseLangTip:{message:"Verificare che la lingua dell'elemento HTML sia uguale a quella della pagina attuale."},filterBoxSr:{message:"Filtri disponibili::"},headingJumpContent:{message:"Salto nell'ordine di intestazione"},headingJumpExplanation:{message:"La struttura delle intestazioni della pagina deve essere organizzata in modo logico e i livelli di intestazione devono aumentare solo di uno. Evitate i salti, ad esempio da H2 a H4."},headingJumpTip:{message:"Cercate di non saltare l'ordine di intestazione."},
