pdfErrorHelp:{message:"Tip:"},pdfExplanation:{message:"Dit PDF-rapport presenteert de resultaten van de analyse. De website is ge\u00ebvalueerd tegen verschillende WCAG-criteria om bruikbaarheid en toegankelijkheid te beoordelen. Aan het begin wordt algemene informatie gegeven en worden de meest voorkomende fouten getoond. Het rapport is georganiseerd in de volgende WCAG-hoofdstukken: Zichtbaar, Bruikbaar, Begrijpelijk, Robuust en Beste Praktijk. Elk hoofdstuk geeft gedetailleerde informatie over de resultaten van de analyse, evenals aanbevelingen voor verbetering. De resultaten worden verder onderverdeeld in WCAG-subhoofdstukken en individuele eye-able teststappen."},
