ariaLabelMoreInformationTip:{message:"Lees meer over methoden voor lange beschrijvingen"},guidedTestDecorativeImageHint:{message:"Hint: Leeg alt-attribuut! Controleer of het een decoratieve afbeelding of element is, in dit geval is geen alt-tekst noodzakelijk."},guidedTestImgPopupTxt:{message:"Begeleide test: tekstalternatief"},guidedTestInfoTextHeading:{message:"Informatie over de begeleide alternatieve teksttest:"},guidedTestInfoText:{message:"Deze begeleide test helpt u bij het controleren van alternatieve teksten voor afbeeldingen. Voor toegankelijkheid moet u handmatig alternatieve teksten controleren om hun betekenis en betekenis te garanderen. Het opnemen van afbeeldingen met en zonder fouten en waarschuwingen is hiervoor noodzakelijk.<br> De volgende tabel vermeldt alle pagina-afbeeldingen samen met hun alternatieve tekst en overeenkomstige HTML-attribuut. Het bevat ook eerder beoordeelde auditfouten en hints voor het corrigeren ervan, samen met de bestandsnaam van de afbeelding."},
