imgNoAltTip:{message:"Dodaj znacz\u0105cy alternatywny tekst za pomoc\u0105 atrybut\u00f3w alt-, aria-label- lub aria-labelledby-. Pusty atrybut alt mo\u017ce by\u0107 u\u017cywany dla obraz\u00f3w dekoracyjnych."},imgShortAltContent:{message:"Alternatywny tekst obrazu jest bardzo kr\u00f3tki (<5 znak\u00f3w)"},imgShortAltExplanation:{message:"Alternatywny tekst obrazu powinien opisywa\u0107 jego zawarto\u015b\u0107 w znacz\u0105cy spos\u00f3b."},imgShortAltTip:{message:"Sprawd\u017a, czy alternatywny tekst odpowiednio opisuje obraz."},
imgVeryLongAltContent:{message:"Alternatywny tekst obrazu jest bardzo d\u0142ugi (>150 znak\u00f3w)"},imgVeryLongAltExplanation:{message:"Alternatywny tekst tego obrazu jest bardzo d\u0142ugi (>150 znak\u00f3w) i mo\u017cliwe, \u017ce mo\u017cna go stre\u015bci\u0107. Wiele os\u00f3b niewidomych czyta teksty za pomoc\u0105 wy\u015bwietlacza Braille'a. Wy\u015bwietlacz Braille'a mo\u017ce wy\u015bwietli\u0107 co najmniej 40 znak\u00f3w, ale maksymalnie 80 znak\u00f3w."},imgVeryLongAltTip:{message:"Streszcz opis do jego istoty."},
importantLetterSpacingContent:{message:"!important odst\u0119p mi\u0119dzy literami w atrybucie stylu"},importantLetterSpacingExplanation:{message:"Ta regu\u0142a sprawdza, czy atrybut stylu nie jest u\u017cywany do zapobiegania dostosowywaniu odst\u0119pu mi\u0119dzy literami za pomoc\u0105 !important, chyba \u017ce jest to co najmniej 0,12 razy wi\u0119ksze ni\u017c rozmiar czcionki. U\u017cycie !important w atrybutach stylu uniemo\u017cliwia nadpisanie tego stylu."},importantLetterSpacingTip:{message:"Je\u015bli to mo\u017cliwe, nie u\u017cywaj !important w atrybucie stylu lub upewnij si\u0119, \u017ce odst\u0119p mi\u0119dzy literami wynosi co najmniej 0,12 razy rozmiar czcionki."},
importantLineSpacingContent:{message:"!important wysoko\u015b\u0107 linii w atrybucie stylu"},importantLineSpacingExplanation:{message:"Ta regu\u0142a sprawdza, czy atrybut stylu nie jest u\u017cywany do zapobiegania dostosowywaniu wysoko\u015bci linii za pomoc\u0105 !important, chyba \u017ce jest to co najmniej 1,5 razy wi\u0119ksze ni\u017c rozmiar czcionki. U\u017cycie !important w atrybutach stylu uniemo\u017cliwia nadpisanie tego stylu."},importantLineSpacingTip:{message:"Je\u015bli to mo\u017cliwe, nie u\u017cywaj !important w atrybucie stylu lub upewnij si\u0119, \u017ce wysoko\u015b\u0107 linii wynosi co najmniej 1,5 razy rozmiar czcionki."},
importantWordSpacingContent:{message:"!important word-spacing in style attribute"},importantWordSpacingExplanation:{message:"Ta regu\u0142a sprawdza, czy atrybut stylu nie jest u\u017cywany do zapobiegania dostosowywaniu odst\u0119pu mi\u0119dzy wyrazami za pomoc\u0105 !important, chyba \u017ce jest to co najmniej 0,16 razy wi\u0119ksze ni\u017c rozmiar czcionki. U\u017cycie !important w atrybutach stylu uniemo\u017cliwia nadpisanie tego stylu."},importantWordSpacingTip:{message:"Je\u015bli to mo\u017cliwe, nie u\u017cywaj !important w atrybucie stylu lub upewnij si\u0119, \u017ce odst\u0119p mi\u0119dzy wyrazami wynosi co najmniej 0,16 razy rozmiar czcionki."},
inputImageNoAltContent:{message:"Brakuj\u0105cy alternatywny tekst w przycisku obrazowym"},inputImageNoAltExplanation:{message:'Graficzny przycisk wymaga alternatywnego tekstu (<input type="image">), aby czytniki ekranowe mog\u0142y odzwierciedli\u0107 jego cel.'},inputImageNoAltTip:{message:"Dodaj znacz\u0105cy atrybut alt lub aria, kt\u00f3ry opisuje zawarto\u015b\u0107 i cel tego obrazu."},inputNoLabelContent:{message:"Pole formularza nie ma dost\u0119pnej nazwy"},inputNoLabelExplanation:{message:'Pole formularza wymaga dost\u0119pnej nazwy, aby czytniki ekranowe mog\u0142y odzwierciedli\u0107 jego cel. Dotyczy to na przyk\u0142ad element\u00f3w <input> i <select> lub element\u00f3w o roli "checkbox" lub "textbox".'},
inputNoLabelTip:{message:"Utw\u00f3rz odpowiedni element <label> lub atrybuty aria, kt\u00f3re opisuj\u0105 cel tego pola formularza. Przy u\u017cyciu etykiety u\u017cyj atrybutu for, kt\u00f3ry pasuje do id elementu input."},inspectElmErr:{message:"B\u0142\u0105d: Prosz\u0119 ponownie uruchomi\u0107 panel element\u00f3w"},inspectElmTip:{message:"Ods\u0142o\u0144 w panelu Elementy (Otw\u00f3rz za pomoc\u0105 F12)"},insufficientLineHeightContent:{message:"Akapit ma niewystarczaj\u0105c\u0105 wysoko\u015b\u0107 linii"},
insufficientLineHeightExplanation:{message:"Wysoko\u015b\u0107 linii akapitu (<p>) jest mniejsza ni\u017c 1,5. Mo\u017ce to wp\u0142yn\u0105\u0107 na czytelno\u015b\u0107 tekstu."},insufficientLineHeightTip:{message:"Zwi\u0119ksz wysoko\u015b\u0107 linii akapitu do co najmniej 1,5."},invalidAriaContent:{message:"Niezdefiniowany atrybut ARIA"},invalidAriaExplanation:{message:'Ta regu\u0142a sprawdza, czy ka\u017cdy atrybut aria-* jest zdefiniowany w <a target="_blank" href="https://www.w3.org/TR/wai-aria/">ARIA 1.1</a>. Nieprawid\u0142owe atrybuty aria nie s\u0105 rozpoznawane przez czytniki ekranowe.'},
invalidAriaTip:{message:"Sprawd\u017a, czy atrybut aria jest \u017ale napisany. Upewnij si\u0119, \u017ce u\u017cywasz prawid\u0142owych atrybut\u00f3w aria."},invalidAutocompleteContent:{message:"Niew\u0142a\u015bciwy atrybut autocomplete"},invalidAutocompleteExplanation:{message:"Ta regu\u0142a dotyczy ka\u017cdego elementu HTML <input>, <select> i <textarea> z warto\u015bci\u0105 atrybutu autocomplete. Atrybut autocomplete musi mie\u0107 poprawn\u0105 warto\u015b\u0107, aby by\u0142 rozpoznawany przez przegl\u0105dark\u0119."},
invalidAutocompleteTip:{message:"Upewnij si\u0119, \u017ce warto\u015b\u0107 autocomplete jest obs\u0142ugiwana."},invalidLangContent:{message:"Wykryto nieprawid\u0142owy atrybut lang"},invalidLangExplanation:{message:'Atrybut lang w elemencie <html> musi by\u0107 prawid\u0142owym kodem j\u0119zyka i zgodnym ze standardem BCP 47, np. "de" lub "en-us".'},invalidLangTip:{message:"Upewnij si\u0119, \u017ce jako atrybut lang elementu <html> ustawiony jest prawid\u0142owy kod j\u0119zyka."},invalidValueAriaContent:{message:"Nieobs\u0142ugiwana warto\u015b\u0107 stanu lub w\u0142a\u015bciwo\u015bci ARIA"},
invalidValueAriaExplanation:{message:'Ta regu\u0142a sprawdza, czy warto\u015bci stan\u00f3w lub w\u0142a\u015bciwo\u015bci <a target="_blank" href="https://www.w3.org/TR/wai-aria/">ARIA</a> s\u0105 dozwolone dla elementu, na kt\u00f3rym s\u0105 okre\u015blone. Stany lub w\u0142a\u015bciwo\u015bci ARIA powinny by\u0107 zgodne z oficjaln\u0105 specyfikacj\u0105.'},invalidValueAriaTip:{message:"Usu\u0144 niespecyfikowane warto\u015bci stan\u00f3w lub w\u0142a\u015bciwo\u015bci ARIA lub popraw je na poprawne warto\u015bci."},
