presentationalChildFocusExplanation:{message:"Ta regu\u0142a sprawdza, czy elementy z rol\u0105, kt\u00f3ra czyni ich dzieci prezentacyjnymi, nie zawieraj\u0105 element\u00f3w, na kt\u00f3rych mo\u017cna ustawi\u0107 fokus. Takimi elementami s\u0105 na przyk\u0142ad <button>, checkbox lub <img>. Dzieci tych element\u00f3w nie s\u0105 prawid\u0142owo wykrywane przez technologie wspomagaj\u0105ce."},presentationalChildFocusTip:{message:"Nie dodawaj element\u00f3w fokusowalnych jako element\u00f3w potomnych element\u00f3w z rol\u0105, kt\u00f3ra sprawia, \u017ce ich dzieci maj\u0105 charakter prezentacyjny."},
prevElmTip:{message:"Poprzedni problem"},preventZoomContent:{message:"Meta viewport zapobiega powi\u0119kszaniu"},preventZoomExplanation:{message:'U\u017cywanie element\u00f3w <meta name="viewport"> mo\u017ce ograniczy\u0107 mo\u017cliwo\u015b\u0107 powi\u0119kszania przez u\u017cytkownika, zw\u0142aszcza na urz\u0105dzeniach mobilnych. Powi\u0119kszanie jest powszechnym i oczekiwanym "dozwolonym" zachowaniem na mobilnych stronach internetowych, wi\u0119c wy\u0142\u0105czenie go pogarsza wra\u017cenia u\u017cytkownika mobilnego.'},
preventZoomTip:{message:'Usu\u0144 atrybuty user-scalable i maximum-scale. W przeciwnym razie upewnij si\u0119, \u017ce atrybut content nie ustawia user-scalable na "no" i \u017ce w\u0142a\u015bciwo\u015b\u0107 maximum-scale wynosi co najmniej 2.'},ptextNotInLandmarkTip:{message:"Dodaj dowoln\u0105 tre\u015b\u0107 tekstow\u0105 do istniej\u0105cych region\u00f3w strony lub utw\u00f3rz nowe regiony."},referenceLinkTip:{message:"Wi\u0119cej informacji"},regionMissingNameContent:{message:"Brak dost\u0119pnej nazwy regionu"},
regionMissingNameExplanation:{message:"Rola regionu s\u0142u\u017cy do identyfikacji obszar\u00f3w dokumentu, kt\u00f3re autor uwa\u017ca za istotne. Ka\u017cdy region potrzebuje dost\u0119pnej nazwy, aby u\u017cytkownicy czytnik\u00f3w ekranu mogli zidentyfikowa\u0107 jego zawarto\u015b\u0107 i cel."},regionMissingNameTip:{message:"Dodaj dost\u0119pn\u0105 nazw\u0119 do regionu za pomoc\u0105 atrybut\u00f3w aria."},requiredChildrenMissingContent:{message:"Pojemnik, w kt\u00f3rym brakuje wymaganych dzieci"},
requiredChildrenMissingExplanation:{message:'Niekt\u00f3re elementy z wyra\u017an\u0105 rol\u0105 semantyczn\u0105 musz\u0105 mie\u0107 co najmniej jeden z wymaganych element\u00f3w w\u0142asnych. Na przyk\u0142ad, element z rol\u0105 "list" musi posiada\u0107 elementy z rol\u0105 "listitem". Niespe\u0142nienie tego wymogu mo\u017ce spowodowa\u0107, \u017ce sam element stanie si\u0119 niewa\u017cny.'},requiredChildrenMissingTip:{message:"Sprawd\u017a, czy rola elementu zosta\u0142a poprawnie u\u017cyta lub upewnij si\u0119, \u017ce u\u017cyto wymaganych w\u0119z\u0142\u00f3w podrz\u0119dnych."},
requiredParentMissingContent:{message:"Brak wymaganego elementu nadrz\u0119dnego"},requiredParentMissingExplanation:{message:'Niekt\u00f3re elementy z wyra\u017an\u0105 rol\u0105 semantyczn\u0105 musz\u0105 mie\u0107 okre\u015blony element nadrz\u0119dny. Na przyk\u0142ad, element z rol\u0105 "listitem" potrzebuje w\u0119z\u0142a nadrz\u0119dnego z rol\u0105 "list". Niespe\u0142nienie tego wymogu powoduje, \u017ce sam element staje si\u0119 niewa\u017cny.'},requiredParentMissingTip:{message:"Sprawd\u017a, czy rola elementu zosta\u0142a poprawnie u\u017cyta lub upewnij si\u0119, \u017ce u\u017cyto wymaganego w\u0119z\u0142a nadrz\u0119dnego i roli."},
resetInputContent:{message:"Przycisk resetowania nie jest zalecany"},resetInputExplanation:{message:"Korzystanie z przycisk\u00f3w resetowania nie jest zalecane, poniewa\u017c mo\u017cna je \u0142atwo klikn\u0105\u0107 przez pomy\u0142k\u0119."},resetInputTip:{message:"Je\u015bli to mo\u017cliwe, usu\u0144 przycisk resetowania."},restrictedOrientationContent:{message:"Orientacja strony jest ograniczona"},restrictedOrientationExplanation:{message:"Ta regu\u0142a sprawdza, czy zawarto\u015b\u0107 strony nie jest ograniczona do orientacji poziomej lub pionowej przy u\u017cyciu w\u0142a\u015bciwo\u015bci transform CSS. Elementy, kt\u00f3re s\u0105 ustalone na okre\u015blony obr\u00f3t, przy u\u017cyciu funkcji no\u015bnika orientacji z warto\u015bci\u0105 krajobrazu lub portretu, mog\u0105 nie obraca\u0107 si\u0119 na urz\u0105dzeniach mobilnych."},
restrictedOrientationTip:{message:"Upewnij si\u0119, \u017ce wszystkie elementy na stronie obracaj\u0105 si\u0119 prawid\u0142owo po prze\u0142\u0105czeniu z trybu pionowego na poziomy."},retractButton:{message:"Schowaj wszystkie"},robustTxt:{message:"Solidny"},ruleOpenImgAlt:{message:"Poka\u017c b\u0142\u0119dy"},rulesOverviewHeading:{message:"Przegl\u0105d wszystkich regu\u0142 audytu Eye-Able\u00ae"},rulesOverviewRegion:{message:"Regu\u0142y"},rulesOverviewTxt:{message:"Wy\u015bwietla wszystkie dost\u0119pne regu\u0142y. Jako rozdzia\u0142 WCAG wy\u015bwietlany jest zawsze tylko g\u0142\u00f3wny odno\u015bnik, dlatego rozwa\u017cane s\u0105 wi\u0119cej rozdzia\u0142\u00f3w WCAG ni\u017c wy\u015bwietlane."},
scanAgain:{message:"Skanuj ponownie"},scrollableKeyboardContent:{message:"Przewijany element nie jest dost\u0119pny z klawiatury"},scrollableKeyboardExplanation:{message:"Ta regu\u0142a sprawdza, czy elementy przewijane mog\u0105 by\u0107 przewijane za pomoc\u0105 klawiatury. Aby upewni\u0107 si\u0119, \u017ce istnieje element, z kt\u00f3rego mo\u017cna u\u017cywa\u0107 klawiszy strza\u0142ek do kontrolowania pozycji przewijania, fokus musi znajdowa\u0107 si\u0119 na lub w obszarze przewijania."},
scrollableKeyboardTip:{message:"Upewnij si\u0119, \u017ce ka\u017cdy przewijany element lub jeden z jego element\u00f3w podrz\u0119dnych jest fokusowalny."},selectLabelContent:{message:"<select> brak dost\u0119pnej nazwy"},selectLabelExplanation:{message:"Elementy <select> musz\u0105 mie\u0107 dost\u0119pn\u0105 nazw\u0119, aby u\u017cytkownicy czytnik\u00f3w ekranu mogli zidentyfikowa\u0107 ich przeznaczenie."},selectLabelTip:{message:"Opisz cel listy wyboru za pomoc\u0105 elementu <label> lub atrybut\u00f3w aria."},
