autoAuditSetting:{message:"Executar auditoria automaticamente ap\u00f3s o carregamento da p\u00e1gina"},autoAuditText:{message:"A execu\u00e7\u00e3o de um teste pode exigir muito desempenho. Se desativar esta defini\u00e7\u00e3o, o teste s\u00f3 ser\u00e1 executado quando entrar no painel de controlo no local."},autoplayContent:{message:"O elemento <audio> ou <video> reproduz automaticamente o \u00e1udio"},autoplayExplanation:{message:"O \u00e1udio ou v\u00eddeo reproduzido automaticamente n\u00e3o pode ter um \u00e1udio que dure mais de 3 segundos ou necessitar de um mecanismo de controlo de \u00e1udio para o parar ou silenciar."},
