bodyAriaHiddenExplanation:{message:'O elemento body cont\u00e9m o atributo aria-hidden: "true", pelo que a p\u00e1gina n\u00e3o \u00e9 acess\u00edvel aos leitores de ecr\u00e3.'},bodyAriaHiddenTip:{message:"Remove o atributo aria-hidden do elemento body."},categorySetting:{message:"Apresentar ensaios apenas das seguintes categorias"},categoryText:{message:"Em alguns casos, n\u00e3o tem controlo sobre certos tipos de erros, por exemplo, no c\u00f3digo da p\u00e1gina. Se, portanto, apenas as regras de uma determinada categoria devem ser apresentadas, os filtros correspondentes podem ser activados aqui."},
