csvUrls:{message:"Todos os URLs encontrados:"},decorativeElementFocusContent:{message:"O elemento decorativo est\u00e1 exposto a tecnologias de assist\u00eancia"},decorativeElementFocusExplanation:{message:"Esta regra verifica se os elementos marcados como decorativos n\u00e3o est\u00e3o inclu\u00eddos na \u00e1rvore de acessibilidade ou se t\u00eam uma fun\u00e7\u00e3o de apresenta\u00e7\u00e3o. Marcar um elemento como decorativo esconde-o das tecnologias de assist\u00eancia, mas torn\u00e1-lo focaliz\u00e1vel exp\u00f5e-no. Este conflito deve ser evitado."},
decorativeElementFocusTip:{message:'Verificar se o elemento precisa de ser marcado como decorativo ou ocult\u00e1-lo das tecnologias de apoio, por exemplo, utilizando aria-hidden="true" ou role="presentation".'},decorativeImageExposedContent:{message:"A imagem decorativa \u00e9 exposta a tecnologias de apoio"},decorativeImageExposedExplanation:{message:"Esta regra verifica se as imagens marcadas como decorativas n\u00e3o est\u00e3o inclu\u00eddas na \u00e1rvore de acessibilidade ou se t\u00eam uma fun\u00e7\u00e3o de apresenta\u00e7\u00e3o. Marcar um elemento como decorativo esconde-o das tecnologias de assist\u00eancia, mas torn\u00e1-lo foc\u00e1vel exp\u00f5e-no. Este conflito deve ser evitado."},
decorativeImageExposedTip:{message:'Verificar se a imagem precisa de ser marcada como decorativa ou ocult\u00e1-la das tecnologias de assist\u00eancia, por exemplo, utilizando aria-hidden="true" ou role="presentation".'},designSetting:{message:"Regras de conce\u00e7\u00e3o"},docuLink:{message:"Aceder \u00e0 documenta\u00e7\u00e3o"},docuLinkLocal:{message:"public/Documentation_Eye_Able_Audit.pdf"},elementInvalidLangContent:{message:"Elemento com atributo lang inv\u00e1lido detectado"},elementInvalidLangExplanation:{message:'As partes de um s\u00edtio Web podem ser marcadas como estando numa l\u00edngua diferente da do resto do s\u00edtio Web utilizando o atributo lang. O atributo lang destes elementos deve tamb\u00e9m ser um c\u00f3digo de l\u00edngua v\u00e1lido e estar em conformidade com a norma BCP 47, por exemplo, "de" ou "en-us".'},
