pdfErrorDescription:{message:"Descri\u00e7\u00e3o do erro:"},pdfErrorExplanation:{message:"Explica\u00e7\u00e3o do erro:"},pdfErrorHelp:{message:"Sugest\u00e3o:"},pdfExplanation:{message:"Este relat\u00f3rio em PDF apresenta os resultados da an\u00e1lise. O s\u00edtio Web foi avaliado com base em v\u00e1rios crit\u00e9rios das WCAG para avaliar a usabilidade e a acessibilidade. No in\u00edcio, s\u00e3o dadas informa\u00e7\u00f5es gerais e s\u00e3o apresentados os erros mais comuns. O relat\u00f3rio est\u00e1 organizado nos seguintes cap\u00edtulos das WCAG: Percet\u00edvel, Utiliz\u00e1vel, Compreens\u00edvel, Robusto e Melhores Pr\u00e1ticas. Cada cap\u00edtulo fornece informa\u00e7\u00f5es pormenorizadas sobre os resultados da an\u00e1lise, bem como recomenda\u00e7\u00f5es de melhoria. Os resultados est\u00e3o ainda divididos em sub-cap\u00edtulos das WCAG e em etapas individuais de testes vis\u00edveis."},
